import React from "react";
import NavBarCV from "./components/NavBar/NavBar";

export default function App() {
  return (
    <div>
      <NavBarCV />
      <Switch>
          <Route path="/Portfolio">
            <Portfolio />
          </Route>
          <Route path="/Contact">
            <ContactCV />
          </Route>
          <Route exact path="/">
            <CV />
          </Route>
        </Switch>
    </div>
  );
}
